/**
 * Get the item with the given key
 * @param {!String|Number} key  The key or index of the item
 * @return {?Object} return the model object for that item, if any.
 */
eYo.Model.math.getItem = function (key) {
  if (!goog.isNumber(key)) {
    key = eYo.Model.math.data.by_name[key]
  }
  if (goog.isNumber(key)) {
    return eYo.Model.math.data.items[key]
  }
}

/**
 * Get the type of the given item.
 * @param {!Object} item.
 * @return {?String} return the type.
 */
eYo.Model.math.getType = function (item) {
  return item && item.type && eYo.Model.math.data.types[item.type]
}

/**
 * Get the indices of the items for the given category
 * @param {!String} key  The name of the category
 * @return {!Array} the list of item indices with the given category (possibly void).
 */
eYo.Model.math.getItemsInCategory = function (category, type) {
  var ra = eYo.Model.math.data.by_category[category] || []
  if (goog.isString(type)) {
    type = eYo.Model.math.data.type.indexOf(type)
  }
  if (goog.isNumber(type) && type >= 0) {
    var ra2 = []
    for (var i = 0; i < ra.length ; i++ ) {
      var item = eYo.Model.math.getItem(i)
      if (item && item.type === type) {
        ra2.append(i)
      }
    }
    return ra2
  } else {
    return ra
  }
}

